MAUI STRONG. HAWAII UNITED Mahalo to all those who are donating and aiding with the efforts in Lahaina during these hard times. Every donation dropped off, and every shipment sent makes a difference. This will be a long, rough road but United we can get through anything. Thank you to the businesses and individuals that stepped up and took action right away with no hesitation. Below is a few businesses that have been taking donations and is working directly with people on the ground in Lahaina. Plz keep spreading awareness, prayers, and aloha for our loved ones that have been affected by this disaster. ❤️🙏🏾 MAUI
@9th_islandkava @jaialboro @2scoopsofalohalv @generationskitchenlv @slashershi @oneeightymaui 

@wayne808 @prettygirl_xo @kelskx3 @_kiakahi_ @poilbda @jazzyfeyy @kien_kobe @_pudgesta @ttoshikiyo24 @akaward @kaui.kauhi @hillsidejimbo @taylortonez @mr__aloha @theroom_byhk @vinnieeelee @j_cabatz @sumiko.inaba @dretattooer @ongodmgmt @b3lex @big_al_medeiros_808 @bigbodycisco @ginorocks

WE GOT WE…
We had some difficulties and obstacles getting our shipment directly to Maui because of unforeseen circumstances. But when one route is denied, you regroup and reroute, and never take no for an answer.  Thank you for all the volunteers who helped sort, pack, palletize. Blessings to those who brought us equipment to work quickly and efficiently. Thank you to all those that brought or bought us supplies as soon as we would post that we needed them, the broker that found us the truck, trailer, and driver to take our load to Cali. on short notice. Big shout out to the dock workers that took our container on hours notice and made it happen. Much Love and Aloha to you all. Maui we love you. Hawaii United. 
@jaialboro @2scoopsofalohalv @generationskitchenlv

